{"id":"CollectionFilterLazyQuery","query":"query CollectionFilterLazyQuery(
  $assetCreator: IdentityInputType
  $assetOwner: IdentityInputType
  $categories: [CollectionSlug!]
  $chains: [ChainScalar!]
  $collections: [CollectionSlug!]
  $count: Int
  $includeHidden: Boolean = false
  $onlyPrivateAssets: Boolean = false
  $query: String
  $sortBy: CollectionSort = SEVEN_DAY_VOLUME
) {
  query {
    collections(assetOwner: $assetOwner, assetCreator: $assetCreator, onlyPrivateAssets: $onlyPrivateAssets, chains: $chains, first: $count, includeHidden: $includeHidden, parents: $categories, query: $query, sortBy: $sortBy) {
      edges {
        node {
          assetCount
          imageUrl
          name
          slug
          isVerified
          id
        }
      }
    }
    selectedCollections: collections(first: 25, collections: $collections, includeHidden: true) {
      edges {
        node {
          assetCount
          imageUrl
          name
          slug
          isVerified
          id
        }
      }
    }
  }
}
